webpackJsonp([0xe6cf8a0945c],{2780:function(e,t){e.exports={data:{markdownRemark:{html:'<p>Apparently it seems that there are many people who are uneasy whether they are really able to send, so just a little commentary.</p>\n<ul>\n<li>\n<p>I want to say something, but it is not as good as writing it on the <a href="https://twitter.com/danmaq">bulletin board</a> , I can write something important, a bit of a word, opinion impression, etc. and send it.</p>\n</li>\n<li>\n<p>Although the <em>confirmation screen may not appear</em> depending on the way of operation, <em>it is sent properly</em> .</p>\n</li>\n<li>\n<p>If you are worried, try pressing the button without writing anything. It will be normal if an error appears and it is played.</p>\n</li>\n<li>\n<p><a href="http://www.webclap.com/">Unlike the home web applause</a> , no applause can be sent without a message.</p>\n</li>\n<li>\n<p>If it is likely to be a long sentence, we strongly recommend using the <a href="https://twitter.com/danmaq">bulletin board</a> .</p>\n</li>\n<li>\n<p>Since the message before 5th May 2006 (Sunday) was set to private, it can not be published. (It can not automatically do it also)</p>\n</li>\n<li>\n<p>Web clapping of this site is irrelevant to <a href="http://www.webclap.com/">web applause</a> of the <a href="http://www.webclap.com/">head family at</a> all.</p>\n<h2>Reference link</h2>\n</li>\n<li>\n<p><a href="http://www.webclap.com/">Web applause</a> (home website)</p>\n</li>\n</ul>',frontmatter:{cover:null,date:"2004-12-28T00:00:00+09:00",strDate:"2004/12/27",title:"How to use web applause"}}},pathContext:{path:"/en/blog/2004/12/28-web拍手もどきの使い方/",langKey:"en"}}}});
